webpackJsonp([0x9559f0e140fd],{707:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Solar Sailer",description:"I am a developer, designer and product manager from France. Co-founder of Pixelnest Studio.",author:"Matthieu Oger",siteUrl:"https://solarsailer.net/"}},markdownRemark:{html:'<p><a href="http://www.elezea.com/2013/06/google-reader-replacement/">Rian Van Der Merwe, my Google Reader replacement setup</a>:</p>\n<blockquote>\n<p>But I do feel like I now know way too much about the RSS reader landscape than I every wanted to. Thanks, Google.</p>\n</blockquote>\n<p>Exactly my feeling.</p>\n<p>I used to read my feeds in one <strong>beautiful</strong> app, whatever the device I was using (Reeder - iPhone, iPad, Mac). Bonus: the sync service (Google Reader) was almost flawless.</p>\n<p>Now, we have a myriad of alternatives, and I can\'t find one that seems as good as Google Reader was â€” <em>and</em> working with each version of Reeder.</p>\n<p>The worst thing in this mess is that a fair amount of the old Google Reader users would have gladly paid for it - the adoption of Feedbin or FeedWrangler clearly demonstrates that.</p>',frontmatter:{date:"2013-06-28",readableDate:"28 June 2013",title:"The search for a Google Reader alternative",showPageTitle:null,excerptLine:null,excerptQuote:{name:"Rian Van Der Merwe",quote:"But I do feel like I now know way too much about the RSS reader landscape than I every wanted to. Thanks, Google."}},fields:{path:"/2013/06/google-reader-alternative/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2013-06-28-google-reader-alternative.md absPath of file >>> MarkdownRemark"}}}});
